import React from "react";

const ColorPalette = () => {
    return <div>
        <h1 className='text-center mt-3'>Site Color Palette</h1>
        <span className="d-block p-2 text-white mt-3"style={{backgroundColor:'#ffE138'}}>#FFE138</span>
        <span className="d-block p-2 text-white">d-block</span>
    </div>
};

export default ColorPalette;
